import React from "react";
import "./Dashboard.scss";

function Dashboard() {
  return (
    <div className='dashboard-container'>
      <p className='dashboard-text'>Column 1</p>
      <p className='dashboard-text2'>Column 2</p>
      <p className='dashboard-text3'>Column 3</p>
      <p className='dashboard-text3'>Column 4</p>
    </div>
  );
}
export default Dashboard;
